import React from 'react';
import UserCard from './UserCard';

const usersData = [
  {
    name: 'Diego Garcia',
    age: 21,
    major: 'Computer Science',
    hobbies: 'Gaming, Traveling',
    careerAspirations: 'Software Engineering',
    imageSrc: `%PUBLIC_URL%/diego-garcia-profile.jpg`,
  },
  {
    name: 'Ayesha Khan',
    age: 20,
    major: 'Psychology',
    hobbies: 'Reading, Painting',
    careerAspirations: 'Medical Consulting',
    imageSrc: `%PUBLIC_URL%/images/ayesha-khan-profile.jpg`,
  },
  {
    name: 'John Davis',
    age: 22,
    major: 'Business Administration',
    hobbies: 'Guitar, Photography',
    careerAspirations: 'Entrepreneurship and Start-ups',
  },
  {
    name: 'Emma Smith',
    age: 19,
    major: 'Biology',
    hobbies: 'Hiking, Cooking',
    careerAspirations: 'Clinical or Medical Research',
  },
];

const Users = () => {
  return (
    <div className="container">
      <div className="row">
        {usersData.map((user) => (
          <UserCard key={user.name} {...user} />
        ))}
      </div>
    </div>
  );
};

export default Users;
